### Describe the feature request

So far, there is not a way to create a boolean ONNX tensor. The following code will fail:
```java
import ai.onnxruntime.*;

public class Example {

    public static void main(String[] args) {

        // Create an OrtEnvironment
        OrtEnvironment env = OrtEnvironment.getEnvironment();

        // Create a 1D boolean array
        boolean[] flatArray = {true, false};

        // Convert the 1D boolean array to a ByteBuffer object
        ByteBuffer buffer = ByteBuffer.allocate(flatArray.length);
        for (boolean b : flatArray) {
            buffer.put(b ? (byte) 1 : (byte) 0);
        }

        // Create an ONNX tensor from the ByteBuffer object
        try {
            OnnxTensor tensor = OnnxTensor.createTensor(env, buffer, new long[]{2}, OnnxJavaType.BOOL);
        } catch (OrtException e) {
            throw new RuntimeException(e);
        }
    }
}
```
This throws exception: 
```
Exception in thread "main" java.lang.IllegalStateException: Impossible to reach here, managed to cast a buffer as an incorrect type
	at ai.onnxruntime.OrtUtil.prepareBuffer(OrtUtil.java:540)
	at ai.onnxruntime.OnnxTensor.createTensor(OnnxTensor.java:692)
	at ai.onnxruntime.OnnxTensor.createTensor(OnnxTensor.java:548)
	at ai.onnxruntime.OnnxTensor.createTensor(OnnxTensor.java:527)
```
If creating a boolean tensor is enabled, something like below, it will unblock the inference restriction with ONNX model.
```java
 OnnxTensor tensor = OnnxTensor.createTensor(env, boolean[] {true, false}, new long[]{2}, OnnxJavaType.BOOL);
```

### Describe scenario use case

This feature is very much needed. For example, consider the use case in https://github.com/huggingface/optimum/releases, section "ORTModelForCausalLM supports decoding with a single ONNX". A merged ONNX model `decoder_model_merged.onnx` is exported. This model will require an model input of expected: (tensor(bool)). However, currently there is no way to create a boolean tensor in Java api and pass it to ONNXRuntime session.

This pull request:

- Updates the existing `SaveCheckpoint` function signature.
   - `SaveCheckpoint` should now be called as a standalone function and does not belong to the training session anymore.
   - Example usage:

```cpp

Ort::CheckpointState checkpoint_state = Ort::CheckpointState::LoadCheckpoint(load_checkpoint_path);
// The checkpoint state includes the entire training session state and hence must outlive the training session 
Ort::TrainingSession training_session = Ort::TrainingSession(Ort::SessionOptions(), checkpoint_state, model_uri);
/* ... */
// Once training is done, the same checkpoint can be saved to a file
Ort::CheckpointState::SaveCheckpoint(checkpoint_state , save_checkpoint_path);

```

- Adds ability to add and get properties from the state.
   - Example usage:

```cpp
int64_t hours_in_a_year= 365 * 24;
state.AddProperty("hours in a year", hours_in_a_year);
auto property_i = state.GetProperty("hours in a year");

float pi = 3.14f;
state.AddProperty("pi", pi);
auto property_f = state.GetProperty("pi");

std::string best_framework("onnxruntime");
state.AddProperty("best framework", best_framework);
auto property_s = state.GetProperty("best framework");
```

- Updates the python bindings with the above two features.
   - `save_checkpoint` example usage:

```py
state = CheckpointState.load_checkpoint(checkpoint_file_path)
model = Module(training_model_file_path, state)
# ...
CheckpointState.save_checkpoint(session_state, checkpoint_save_path)

```
   - `add_property` and `get_property` example usage:

```py
state = CheckpointState.load_checkpoint(checkpoint_file_path)

state["property"] = property_value
assert "property" in state
assert state["property"] == property_value
```

- Adds detailed documentation for python bindings.
- Enables python bindings test in CI pipeline.
- Updates C# bindings for `SaveCheckpoint` method to reflect changes in C api. Missing C# bindings will be added in a follow up PR.

